import { useContext } from "react";
import { CartContext } from "./CartContext";

const Cart = () => {

    const {clear, addToCart}  = useContext(CartContext);
    return(
        <div className="text-center m-2">  
        {
            addToCart.cartList.length === 0 ? <h4>Tu Carrito de compras se encuentra vacio</h4> 
            :addToCart.cartList.map((productos) => (<p>{productos.name}</p>))
        }

        </div>
        
    )
}

export default Cart;
